import { CREATE_ACCOUNT } from './types';
import axios from 'axios';

export const createAccount = (userData) => async dispatch => {
    console.log(userData);
    await axios
    const fd = new FormData();
        fd.append('profilePic', this.state.profilePic)
        .post('http://localhost:5000/users/new', userData)
        .then( res => dispatch({
            type: CREATE_ACCOUNT,
            payload: res.status
        }))
}
